addcode/loadlibrary/.body:
初始化Library(常用)

首先在登陆幽灵分析平台上注册您的APP，并由此得到一个唯一的APP key，比如是 YourSpecterToken。示例如下：

    1. Specter *specter = [Specter sharedInstanceWithToken:@" YourSpecterToken"];


    2. Specter *specter = [Specter sharedInstanceWithToken:@" YourSpecterToken" launchOptions:launchOptions];

addcode/trackevent/.body:
上报事件(常用)

幽灵SDK支持手动事件上报，并且可携带自定义的属性，示例如下：

    1. [specter track:@"eventName"];

    2. [specter track:@"eventName" properties: @{@"prop1": @"value1", @"prop2": @"value2"}];

addcode/timeevent/.body:
计时事件(常用)

您可以跟踪一个动作发生的时间,比如一个图像上传或评论文章,使用timeEvent: 这将标志着“开始”你的行动,你就可以完成跟踪回调。然后时间被记录在“持续时间”属性。示例如下：


    [specter timeEvent:@"Image Upload"];
    [self uploadImageWithSuccessHandler:^{
            [specter track:@"eventName"];
        }];

addcode/cleartimerevents/.body:
清除所有计时事件

当前你不需要所有的计时事件时，可以通过clearTimerEvents清除掉。示例如下：


    [specter clearTimedEvents];

addcode/registersuperprop/.body:
注册超级属性


在您发送的每个事件中包含某些属性是很常见的。一般来说，这些都是关于用户的，而不是关于特定事件的，例如用户的年龄、性别或来源。

为了使这些功能变得更容易，您可以将这些属性注册为超级属性。如果您这样做，我们将自动将它们包括所有跟踪事件。超级属性保存到存储设备，并将始终在你的应用程序调用。Specter已经储存了一些信息作为默认的超级性能；看到一个充满Specter默认属性列表在这里。

设置超级性能，叫registersuperproperties:

发送一个“name：niwodai”的属性，将被发送给所有的track 回调。示例如下:
 [specter registerSuperProperties:@{@"name": @"niwodai"}];


向前一步：每当您发送一个事件时，超级属性将包含为属性，示例如下: [specter track:@"eventName" properties: @{
     @"prop1": @"value1"
 }];


后退一步：调用上报事件，就像直接添加的属性，示例如下: [specter track:@"eventName" properties: @{
     @"prop1": @"value1",
     @"name": @"niwodai"
 }];

addcode/registersuperproponce/.body:
一次性设置超级属性

如果您想存储超级属性只有一次(经常像广告或源)，你可以使用registersuperpropertiesonce：。这个函数的行为像registersuperproperties：具有相同的接口，但不能重写你已经保存的超级属性。示例如下：
    [specter registerSuperPropertiesOnce:@{
        @"source": @"ad-01"
    }];

这意味着，调用registersuperpropertiesonce是安全的：对每一个应用程序的负载相同的属性，它只会把它当超级属性不存在。

addcode/unregistersuperprop/.body:
注销超级属性

当您不需要某些超级属性了，可以调用unregisterSuperProperties 注销掉。示例如下：

    [specter unregisterSuperProperties:@{
        @"source": @"ad-01"
    }];

addcode/clearsuperprop/.body:
清除所有超级属性

当然你可以调用方法clearSuperProperties清除所有的超级属性。示例如下：

    [Specter clearSuperProperties];

addcode/people/set/.body:
设置文件属性


设置用户 13793的 “Plan”属性的值为 “Premium”。示例如下： [specter.people set:@"Plan" to:@"Premium"];


在用户13793的配置文件里，将设置一个“Plan”属性，带有一个值“Premium”。在Specter中如果没有一个配置文件存在distinct_id 13793的，一个新的配置文件将被创建。如果用户13793在其配置文件中已经有一个名为“Plan”的属性，则旧值将用“高级”覆盖。

addcode/people/increment/.body:
递增的数字属性

这是有用的，当你想保持一个运行记录的东西，如玩游戏，发送邮件，或赚取点。可以使用people increment：改变数字属性的当前值。示例如下：

    [specter.people increment:@"point count" by:@500];
    [specter.people increment:@{
        @"dollars spent":@17,
        @"credits remaining":@-34
    }];

addcode/trackcharge/.body:
跟踪收入


Specter便于分析你从个人客户赚取的收入。通过将收费与用户配置文件相关联，您可以比较不同客户段的收入，并计算诸如终身价值之类的东西。
你可以跟踪people的单个交易trackcharge:。这个调用将增加交易的个人用户配置文件，这也将反映在Specter收入报告。示例如下：


    [specter.people trackCharge:@(100.77)];
    [specter.people trackCharge::@25 withProperties:@{
        @"$time":@"2016-01-02T00:00:00"
    }];

addcode/addpush/.body:
注册推送通知

Specer Library包括发送推送通知设备令牌Specter的支持。一旦你发送装置的标记，您可以使用Specter发送推送通知到你的应用程序。示例如下：

- (void)application:(UIApplication *)application didRegisterForRemoteNotificationsWithDeviceToken:
 (NSData *)deviceToken
 {
    Specter *specter = [Specter sharedInstance];
    [specter identify:@"13793"];
    [specter.people addPushDeviceToken:deviceToken];
 }

switchflag/trackdata.html.body:
上报标识开关
一、上报开关是通过decide通信接口中获取，开关字段为：report_flag，代码如下：
NSDictionary *config = object[@"report_config"];
if (config && [config isKindOfClass:NSDictionary.class]) {
    NSNumber *reportFlag = config[@"report_flag"];
    if (reportFlag && [reportFlag isKindOfClass:[NSNumber class]]) {
        if (reportFlag.integerValue == 1) {
            self.validationEnabled = YES;
        }else {
            self.validationEnabled = NO;
        }
    }
}

注意：

上报开关开启上报所有事件数据：

手动埋点事件
全埋点事件
可视化埋点事件

SDK默认事件包括：

第一次打开App的上报事件
页面停留时间事件
App崩溃事件


二、上报模式
也是通过decide通信接口中获取，开关字段为：report_flag，代码如下：
NSNumber *reportPattern = config[@"report_pattern"];
if (reportPattern && [reportPattern isKindOfClass:NSNumber.class]) {
    if (reportPattern.integerValue == 1) {
        self.validationMode = AutomaticEventModeVisualization;
    } else {
        self.validationMode = AutomaticEventModeAll;
    }
}                

> 分为以下两种模式：
> 1. 全埋点模式
> 2. 可视化埋点模式。

switchflag/shake.html.body:
摇一摇标识开关

该功能是在UIViewController的分类中增加的，文件：UIViewController+ShakeAndCutter.m,开关标识开关代码如下：

- (void) motionEnded:(UIEventSubtype)motion withEvent:(UIEvent *)event {
    //摇动结束
    if (event.subtype == UIEventSubtypeMotionShake) {// 判断是否是摇动结束
        NSLog(@"摇动结束");
        if ([Specter sharedInstance].enableShake) {
            [[Specter sharedInstance] connectToABTestDesigner];
        }
    }
}
